    const className = {
        container: "w-full bg-dark-gray p-32 text-center",
        title: "text-3xl font-medium font-Playfair_Display"
    };

    const Data = Datas.page_1;

    return (
        <div className={className.container}>
            <h1 className={className.title}>
                {Data.title}
